My activity is around Jacqueline Woodson’s book The Day You Begin which talks about different ways students can feel othered at school. Towards the end it encourages students to speak up about their differences and experiences and celebrates all students for their individual cultures.
•
Keep checking in throughout the week in my stories as I highlight other educators who are also sharing books and activities to do with your students this upcoming school year.
•
**These books and activities are just the tip of the iceberg in terms of bringing more discussion around equity and diversity into the classroom. Please note that these conversations and your own research around issues of diversity and equity should be continued throughout the entire year.**
